class Solution(object):
    def findRepeatedDnaSequences(self, s):
        """
        :type s: str
        :rtype: List[str]
        """
        l = 10
        fragment = []
        for i in xrange(0,len(s)-9):
            if s[i:i+l] not in fragment:
                pos = s.find(s[i:i+l],i+1)
                if pos != -1:
                    fragment.append(s[i:i+l])

        return fragment

