#faster solution

class Solution(object):
    def findRepeatedDnaSequences(self, s):
        """
        :type s: str
        :rtype: List[str]
        """
        n = len(s)
        if n <= 10:
            return []
        l = 10
        dic = {}
        fragment = []
        for i in xrange(0,len(s)-9):
            if s[i:i+l] not in dic:
                dic[s[i:i+l]] = 1
            elif dic[s[i:i+l]] == 1:
                fragment.append(s[i:i+l])
                dic[s[i:i+l]] = 2
                
        return fragment
